import React, { useState } from 'react';
import {
  Container,
  Typography,
  TextField,
  Box,
  Grid,
  AppBar,
  Toolbar,
  Select,
  MenuItem,
  FormControl,
  InputLabel,
  SelectChangeEvent,
  Link,
  IconButton,
} from '@mui/material';
import GitHubIcon from '@mui/icons-material/GitHub';
import YouTubeIcon from '@mui/icons-material/YouTube';
import PersonIcon from '@mui/icons-material/Person';
import MenuIcon from '@mui/icons-material/Menu';

import { patterns } from './data/patterns';
import PatternCard from './components/PatternCard';

function App() {
  const [searchTerm, setSearchTerm] = useState('');
  const [difficultyFilter, setDifficultyFilter] = useState<string>('all');
  const [starredPatterns, setStarredPatterns] = useState<Set<string>>(new Set());

  const handleSearchChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    setSearchTerm(event.target.value);
  };

  const handleDifficultyChange = (event: SelectChangeEvent) => {
    setDifficultyFilter(event.target.value);
  };

  const toggleStar = (patternName: string) => {
    setStarredPatterns(prev => {
      const newSet = new Set(prev);
      if (newSet.has(patternName)) {
        newSet.delete(patternName);
      } else {
        newSet.add(patternName);
      }
      return newSet;
    });
  };

  const filteredPatterns = patterns.filter(pattern => {
    const matchesSearch = pattern.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
      pattern.questions.some(q => q.name.toLowerCase().includes(searchTerm.toLowerCase()));

    const matchesDifficulty = difficultyFilter === 'all' ||
      pattern.questions.some(q => q.difficulty === difficultyFilter);

    return matchesSearch && matchesDifficulty;
  });

  return (
    <Box sx={{ flexGrow: 1, bgcolor: '#121212', minHeight: '100vh' }}>
      <AppBar position="static" sx={{ bgcolor: '#1e1e1e' }}>
        <Toolbar>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1, fontWeight: 'bold', color: '#ffffff' }}>
            AlgoMaster
          </Typography>
          <Box sx={{ display: { xs: 'none', md: 'flex' }, alignItems: 'center', mr: 2 }}>
            <Link href="#" color="inherit" underline="none" sx={{ mx: 1, color: '#bdbdbd', '&:hover': { color: '#ffffff' } }}>Learn</Link>
            <Link href="#" color="inherit" underline="none" sx={{ mx: 1, color: '#bdbdbd', '&:hover': { color: '#ffffff' } }}>Practice</Link>
            <Link href="#" color="inherit" underline="none" sx={{ mx: 1, color: '#bdbdbd', '&:hover': { color: '#ffffff' } }}>Newsletter</Link>
          </Box>
          <Box sx={{ display: 'flex', alignItems: 'center' }}>
             <IconButton color="inherit" href="#" target="_blank"><YouTubeIcon fontSize="small"/></IconButton>
             <IconButton color="inherit" href="#" target="_blank"><GitHubIcon fontSize="small"/></IconButton>
             <IconButton color="inherit"><PersonIcon fontSize="small"/></IconButton>
             <IconButton color="inherit" sx={{ display: { xs: 'block', md: 'none' } }}><MenuIcon fontSize="small"/></IconButton>
          </Box>
        </Toolbar>
      </AppBar>

      <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
         <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 3, gap: 2, flexDirection: { xs: 'column', sm: 'row' } }}>
            <TextField
              size="small"
              placeholder="Search patterns or questions..."
              value={searchTerm}
              onChange={handleSearchChange}
              sx={{ flexGrow: 1, bgcolor: '#212121', '.MuiOutlinedInput-notchedOutline': { borderColor: '#424242' }, input: { color: '#e0e0e0' }, label: { color: '#bdbdbd' } }}
              InputLabelProps={{ style: { color: '#bdbdbd' } }}
            />
            <FormControl size="small" sx={{ minWidth: 120, bgcolor: '#212121', '.MuiOutlinedInput-notchedOutline': { borderColor: '#424242' }, '.MuiSelect-select': { color: '#e0e0e0' }, '.MuiSvgIcon-root': { color: '#e0e0e0' } }}>
              <InputLabel style={{ color: '#bdbdbd' }}>Difficulty</InputLabel>
              <Select
                value={difficultyFilter}
                label="Difficulty"
                onChange={handleDifficultyChange}
              >
                <MenuItem value="all">All</MenuItem>
                <MenuItem value="Easy">Easy</MenuItem>
                <MenuItem value="Medium">Medium</MenuItem>
                <MenuItem value="Hard">Hard</MenuItem>
              </Select>
            </FormControl>
         </Box>

        <Grid container spacing={3}>
          {filteredPatterns.map((pattern) => (
            <Grid item xs={12} key={pattern.name}>
              <PatternCard
                pattern={pattern}
                isStarred={starredPatterns.has(pattern.name)}
                onToggleStar={() => toggleStar(pattern.name)}
              />
            </Grid>
          ))}
        </Grid>
      </Container>
    </Box>
  );
}

export default App;
